full_reasoning:
Step‐by‐step reasoning:
1. Key psychological mechanisms: Responders value the monetary gain provided by the offer (split_self) but adjust this gain by comparing it to what they consider “fair” based on their relative token contribution. In other words, responders compare the observed offer to a baseline “fair share” determined by token_self relative to the total tokens (token_self + token_opp). A deviation below fairness is penalized while an offer that exceeds fairness is rewarded.

2. Mechanism interactions: The utility of accepting an offer is a combination of the intrinsic monetary value (split_self) and the adjustment relative to fairness (the difference between split_self and a fair share). A positive fairness deviation increases the utility and a negative deviation decreases it.

3. Mathematical form: A linear formulation is used where the utility is the sum of a baseline bias, the money offered (split_self) and a term that weights the difference between split_self and fair_share. That is:
  U_accept = β₀ + split_self + λ * (split_self – fair_share)
with fair_share defined as:
  fair_share = combined_earning * token_self / (token_self + token_opp)

4. Learnable parameters: β₀ (an additive bias parameter) and λ (a fairness sensitivity parameter) are the only learnable parameters. Their bounds will be chosen generously (for example, β₀ ∈ [–100,100] and λ ∈ [–10,10]).

5. Mapping to observable behavior: The model uses observed proposals (split_self), participant contributions (token_self), opponent contributions (token_opp), and the combined pot (combined_earning) to compute an “acceptance utility.” The computed utility is then used to gauge the probability of acceptance (with negative values corresponding to “unlikely” choices). Note that we do not model the utility of rejecting an offer here.

The final formal specification is provided below.

<MODEL>
U_accept = beta_0 + split_self + lambda_param * (split_self - (combined_earning * token_self / (token_self + token_opp)))
</MODEL>

